-- ----------------------------
-- Table structure for `xb_sys_contentmanagement`
-- ----------------------------
DROP TABLE IF EXISTS `xb_sys_contentmanagement`;
CREATE TABLE `xb_sys_contentmanagement` (
  `ID` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `CategoriesID` int(11) NOT NULL COMMENT '分类id',
  `UrlType` tinyint(4) DEFAULT '1' COMMENT '跳转类型 1是外部链接 2站内详情',
  `Url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '跳转外部地址',
  `Title` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '标题',
  `CoverImage` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '封面',
  `Soruce` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '文章来源',
  `Lead` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '简单简介',
  `Author` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '作者',
  `Contents` text COLLATE utf8_bin COMMENT '文章内容',
  `IsPublish` tinyint(2) DEFAULT '0' COMMENT '发布',
  `IsTui` tinyint(2) DEFAULT '0' COMMENT '是否推广 1是 0不是',
  `Sort` int(11) DEFAULT '999' COMMENT '排序',
  `AddTime` datetime DEFAULT NULL COMMENT '添加时间',
  `AddUserID` int(11) DEFAULT NULL COMMENT '添加人id',
  `ViewCounk` int(11) DEFAULT '0' COMMENT '浏览量',
  `SEOTitle` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'seo标题',
  `SEOKeyWords` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '关键字',
  `SEODescription` text COLLATE utf8_bin COMMENT '描述',
  `OperatorID` int(11) DEFAULT NULL COMMENT '操作者ID',
  `UpdateTime` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

